# Save results to file
function save_results(filename, q, k_omega_dict)
    open("$filename.csv", "a") do io
        if filesize("$filename.csv") == 0
            println(io, "q,k,omega")
        end
        for (k, omega) in k_omega_dict
            for o in omega
                println(io, "$q, $k, $o")
            end
        end
    end
end

