# Plot and fit results
function fit(q, k, omega)

    curve_model(x, p)= p[1] .*x.^ p[2] .+ p[3]

    # Fit the imaginary part of the eigenmodes to a curve
    fit_result = curve_fit(curve_model, k, omega, [1.0, 1.0, -3.5])
    
    println("Fitted parameters for the imaginary part: ", fit_result.param)

    plot(k, curve_model(k, fit_result.param), label="Extended fit for Im(ω)", legend=:outertopleft)
    plot!(k , omega, seriestype = :scatter, xlabel="k", ylabel="Im(ω)",label= "Im(ω(k))" ,title="Dispersion \$ω(k) q=0.99q_{extr}\$ ", legend=:outertopleft)
    display(plot!(size=(800, 600)))
    println(k)
    println(omega)
end

#---------------------------------------------------------#
# Horizon expansion
I = im
E = ℯ
#=
expansionOrder = 8
function phiHorizonExpansion(q, k, omega)
    u, c0 = [0.9, 1]
    coefficents = computeExpansionCoefficients(q, k, omega)
    return (1-u)^(omega * im / (2 * (-2 + q^2))) * sum([coefficents[i] * (1-u)^(i-1) for i in 1:expansionOrder])
end

function dphiHorizonExpansion(q, k, omega)
    u, c0 = [0.9, 1]
    coefficents = computeExpansionCoefficients(q, k, omega)
    return (1-u)^(omega * im / (2 * (-2 + q^2))) * sum([coefficents[i] * (1-i) * (1-u)^(i-2) for i in 1:expansionOrder]) - 
    (omega * im / (2 * (-2 + q^2))) * (1-u)^(omega * im / (2 * (-2 + q^2)) - 1) * sum([coefficents[i] * (1-u)^(i-1) for i in 1:expansionOrder]) 
end

